Vue.component("loading-button", {
    template:
        '\x3ca v-if\x3d"isLink" :href\x3d"path" class\x3d"lnk" :aria-label\x3d"ariaLabel"\x3e \n                    \x3cbutton class\x3d"loading-button" :class\x3d"buttonStyles"\x3e\n                        \x3cspan class\x3d"text" :class\x3d"buttonColor \x3d\x3d\x3d \'blue\' ? \'color-white\' : \'color-blue\'"\x3e{{text}}\x3c/span\x3e\n                        \x3cloading-indicator :color\x3d"buttonColor \x3d\x3d\x3d \'blue\' ? \'white\' : \'blue\'" /\x3e\n                        \x3cspan v-if\x3d"mouseOverEffect \x26\x26 !loading" class\x3d"icon icon-right-arrow"\x3e\x3c/span\x3e\n                    \x3c/button\x3e                                          \n                \x3c/a\x3e\n                \x3cbutton v-else class\x3d"loading-button" :class\x3d"buttonStyles" :aria-label\x3d"ariaLabel"\x3e\n                    \x3cspan class\x3d"text" :class\x3d"buttonColor \x3d\x3d\x3d \'blue\' ? \'color-white\' : \'color-blue\'"\x3e{{text}}\x3c/span\x3e\n                    \x3cloading-indicator :color\x3d"buttonColor \x3d\x3d\x3d \'blue\' ? \'white\' : \'blue\'" /\x3e\n                    \x3cspan v-if\x3d"mouseOverEffect \x26\x26 !loading" class\x3d"icon icon-right-arrow"\x3e\x3c/span\x3e\n                \x3c/button\x3e',
    computed: {
        buttonStyles: function () {
            var a = [];
            a.push("background-" + this.buttonColor);
            this.loading && a.push("loading");
            this.mouseOverEffect && a.push("button m-s-top button-link-animation");
            this.mouseOverEffectDesktopOnly && a.push("button-link-animation-desktop");
            return a.join(" ");
        },
    },
    props: {
        name: String,
        path: String,
        text: String,
        loading: { type: Boolean, default: !0 },
        mouseOverEffect: { type: Boolean, default: !1 },
        mouseOverEffectDesktopOnly: { type: Boolean, default: !1 },
        isLink: { type: Boolean, default: !1 },
        buttonColor: { type: String, default: "blue" },
        ariaLabel: String,
    },
});
